// src/AdminEntries.js
import React, { useState, useEffect } from 'react';
import './AdminEntries.css';

function AdminEntries() {
  // Giriş kayıtlarını tutan state
  const [entries, setEntries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  // Yeni giriş ekleme form state'i
  const [newEntry, setNewEntry] = useState({
    arac_plaka: '',
    calisan_ID: ''
  });

  // API'den giriş kayıtlarını çek
  const fetchEntries = async () => {
    try {
      const res = await fetch('/api/giris');
      const data = await res.json();
      setEntries(data);
      setLoading(false);
    } catch (err) {
      console.error('Giriş kayıtları çekilirken hata:', err);
      setError('Giriş kayıtları çekilirken bir hata oluştu.');
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchEntries();
  }, []);

  // Yeni giriş ekleme işlemi
  const handleAddEntry = async (e) => {
    e.preventDefault();
    // Basit validasyon
    if (!newEntry.arac_plaka || !newEntry.calisan_ID) {
      setError('Lütfen tüm alanları doldurun.');
      return;
    }
    try {
      const res = await fetch('/api/giris', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(newEntry)
      });
      if (!res.ok) {
        const errData = await res.json();
        setError(errData.error || 'Giriş kaydı eklenemedi.');
        return;
      }
      setNewEntry({ arac_plaka: '', calisan_ID: '' });
      fetchEntries();
    } catch (err) {
      console.error('Giriş eklenirken hata:', err);
      setError('Giriş eklenirken bir hata oluştu.');
    }
  };

  return (
    <div className="admin-entries-container">
      <h2>Girişler Yönetimi</h2>
      
      {/* Yeni Giriş Ekleme Formu */}
      <form className="add-entry-form" onSubmit={handleAddEntry}>
        <h3>Yeni Giriş Kaydı Ekle</h3>
        {error && <div className="error">{error}</div>}
        <div className="form-row">
          <label>Araç Plaka:</label>
          <input
            type="text"
            value={newEntry.arac_plaka}
            onChange={(e) =>
              setNewEntry({ ...newEntry, arac_plaka: e.target.value })
            }
            required
          />
        </div>
        <div className="form-row">
          <label>Çalışan ID:</label>
          <input
            type="text"
            value={newEntry.calisan_ID}
            onChange={(e) =>
              setNewEntry({ ...newEntry, calisan_ID: e.target.value })
            }
            required
          />
        </div>
        <button type="submit">Giriş Kaydı Ekle</button>
      </form>
      
      {/* Giriş Kayıtları Tablosu */}
      {loading ? (
        <div>Yükleniyor...</div>
      ) : (
        <table className="entries-table">
          <thead>
            <tr>
              <th>Giriş ID</th>
              <th>Araç Plaka</th>
              <th>Giriş Saati</th>
              <th>Çıkış Durumu</th>
            </tr>
          </thead>
          <tbody>
            {entries.length > 0 ? (
              entries.map((entry) => (
                <tr key={entry.giris_ID}>
                  <td>{entry.giris_ID}</td>
                  <td>{entry.arac_plaka}</td>
                  <td>{new Date(entry.giris_saat).toLocaleString()}</td>
                  <td>{entry.cikis_durumu}</td>
                </tr>
              ))
            ) : (
              <tr>
                <td colSpan="4">Giriş kaydı bulunamadı.</td>
              </tr>
            )}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default AdminEntries;
